import React from 'react';

function CryptoList(props) {
    return(
        <div className='CryptoList'>
            <ul className='TheList'>
                <li>BTC/USD</li>
                <li>BTC/GBP</li>
            </ul>
        </div>
    )
}

export default CryptoList
